import React from 'react';

const UserPanel = ({ users = [], roomId, onToolChange, onClearBoard, onSaveNotes, onExport }) => {
  const getInitials = (name) => {
    return name
      .split(' ')
      .map(word => word.charAt(0))
      .join('')
      .toUpperCase()
      .slice(0, 2);
  };

  const getRandomColor = (name) => {
    const colors = [
      '#667eea', '#764ba2', '#f093fb', '#f5576c',
      '#4facfe', '#00f2fe', '#43e97b', '#38f9d7',
      '#fa709a', '#fee140', '#a8edea', '#fed6e3'
    ];
    const index = name.charCodeAt(0) % colors.length;
    return colors[index];
  };

  const handleToolChange = (tool) => {
    if (onToolChange) {
      onToolChange(tool);
    }
  };

  const handleClearBoard = () => {
    if (onClearBoard) {
      onClearBoard();
    }
  };

  const handleSaveNotes = () => {
    if (onSaveNotes) {
      onSaveNotes();
    }
  };

  const handleExport = () => {
    if (onExport) {
      onExport();
    }
  };

  return (
    <div className="user-panel">
      <div className="user-panel-header">
        <h3>Meeting Participants</h3>
        <div className="user-count">{users.length}</div>
        <div className="user-count-label">
          {users.length === 1 ? 'participant' : 'participants'} in meeting
        </div>
      </div>
      
      <div className="users-list">
        {users.length === 0 ? (
          <div className="empty-state">
            <div className="empty-state-icon">👥</div>
            <p>No participants yet</p>
            <p style={{ fontSize: '0.8rem', opacity: 0.7 }}>Share the room link to invite others</p>
          </div>
        ) : (
          users.map((user, index) => (
            <div key={user.id || index} className="user-item">
              <div 
                className="user-avatar"
                style={{ background: getRandomColor(user.name || 'User') }}
              >
                {getInitials(user.name || 'User')}
              </div>
              <div className="user-info">
                <div className="user-name">{user.name || `Participant ${index + 1}`}</div>
                <div className="user-status">
                  <div className="status-dot"></div>
                  Active
                </div>
              </div>
            </div>
          ))
        )}
      </div>
      
      <div className="controls-panel">
        <div className="control-group">
          <h4>Meeting Room</h4>
          <div className="room-id">{roomId || 'Default Meeting'}</div>
        </div>
        
        <div className="control-group">
          <h4>Drawing Tools</h4>
          <div className="control-buttons">
            <button 
              className="control-btn active" 
              onClick={() => handleToolChange('freehand')}
            >
              ✏️ Freehand
            </button>
            <button 
              className="control-btn" 
              onClick={() => handleToolChange('circle')}
            >
              🔴 Circle
            </button>
            <button 
              className="control-btn" 
              onClick={() => handleToolChange('rectangle')}
            >
              ⬜ Rectangle
            </button>
          </div>
        </div>
        
        <div className="control-group">
          <h4>Meeting Actions</h4>
          <div className="control-buttons">
            <button 
              className="control-btn" 
              onClick={handleClearBoard}
            >
              🗑️ Clear Board
            </button>
            <button 
              className="control-btn" 
              onClick={handleSaveNotes}
            >
              💾 Save Notes
            </button>
            <button 
              className="control-btn" 
              onClick={handleExport}
            >
              📋 Export
            </button>
          </div>
        </div>
        
        <div className="control-group">
          <h4>AI Features</h4>
          <div className="control-buttons">
            <button className="control-btn active">🤖 Auto-Correct Shapes</button>
            <button className="control-btn">📝 Text Recognition</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserPanel;
